import React from "react";
import ReactDOM from "react-dom";

class HeaderClass extends React.Component{
    render(){
        return(
            <header>{this.props.title}</header>
        )
    }
}

class AppClass extends React.Component{
    Text = "help text";
    h1 = "Hello World!!!";
    sometext = "texts".length;
    render(){
        return(
            <div className="name">
            <HeaderClass title="Шапка сайта" />
            <HeaderClass title="Шапка сайта!!!" />
            <HeaderClass title="!!!" />
            <h1>{this.h1}</h1>
            <input placeholder={this.Text} onClick={this.inputClick} onMouseEnter={this.inputEnter}/>
            <p>{1 + 4}</p>
            <p>{5 === this.sometext ? "Hello" : "Friend"}</p>
        </div>
        )
    }
    inputClick = () => console.log("Clicked");
    inputEnter = () => console.log("Mouse Over");

  
}
export default AppClass;
